BI Tips is the ultimate second screen app for tipsters. It accumulates everything you need to make an informed decision and chose an outcome: from tips and picks to team and tournament statistics and live match feed. And it's absolutely free to download!

What you’ll get right now (and it’s only the beginning):

• tips from experts;
• instant scores;
• live match feeds with lineups and tactical formations;
• more than 200 tournaments with easy-to-use tables, schedules and stats;
• push notifications, reliable, fast and easily customized

About responsible game:
• The application is directed to an adult audience
• The game does not allow you to bet on real money or the opportunity to win real money prizes or gifts
• Cannot exchange your winnings or balance for real money
• Practice or success in social bets does not guarantee success in real money bets.
